import React,{useState} from 'react';
import {
    Container,
    Form,
    FormGroup,
    Label,
    Input
}from 'reactstrap';

export const Forms=()=>{
    const [name,setName]=useState('');
    const [college,setCollege]=useState('');
    return(
        <Container>
            <Form>
                <FormGroup>
                    <Label>Name</Label>
                    <Input type='text' value={name}/>
                    <Label>College</Label>
                    <Input type="text" value={college}/>
                </FormGroup>
            </Form>
        </Container>
    )
}
